--
-- Name: accept_request(character varying, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.accept_request(p_user_notification_id character varying, p_worker_id integer) RETURNS TABLE(notification_id integer, user_id integer, service_booked jsonb, longitude double precision, latitude double precision, fcm_token text)
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Check if any acceptance already exists
    IF EXISTS (SELECT 1 FROM accepted WHERE user_notification_id = p_user_notification_id) THEN
        RAISE EXCEPTION 'Someone already accepted the request.';
    END IF;

    -- Retrieve notification details and FCM token
    RETURN QUERY
    WITH notification_data AS (
        SELECT 
            n.cancel_status, 
            n.user_id, 
            n.notification_id, 
            n.service_booked, 
            n.longitude, 
            n.latitude, 
            uf.fcm_token
        FROM notifications n
        LEFT JOIN userfcm uf ON n.user_id = uf.user_id
        WHERE n.user_notification_id = p_user_notification_id
        FOR UPDATE -- Lock the selected row for the duration of the transaction
    )
    SELECT 
        nd.notification_id,
        nd.user_id,
        nd.service_booked,
        nd.longitude,
        nd.latitude,
        nd.fcm_token
    FROM notification_data nd
    WHERE nd.cancel_status <> 'cancel';

    IF NOT FOUND THEN
        RAISE EXCEPTION 'Notification not found or has been canceled.';
    END IF;

    -- Insert into accepted
        user_notification_id, 
        worker_id, 
        notification_id, 
        status, 
        user_id, 
        service_booked, 
        pin, 
        longitude, 
        latitude
    )
    SELECT 
        p_user_notification_id,
        p_worker_id,
        nd.notification_id,
        'accept',
        nd.user_id,
        nd.service_booked,
        FLOOR(RANDOM() * 9000) + 1000,
        nd.longitude,
        nd.latitude
    FROM notification_data nd
    RETURNING nd.notification_id INTO notification_id;

    -- Delete the notification
    DELETE FROM notifications 
    WHERE user_notification_id = p_user_notification_id;

END;
$$;


